import React from 'react';
import './dev_test.css';

function dev_test() {
  return (
    <div className="dev_test_Link__container">
      <span>
        <p>“dev_test Link.” </p>
        <p><a href="http://www.naver.com" target="_blank">네이버</a></p>
      </span>
      <span>- George Orwell, 1984</span>
    </div>
  );
}

export default dev_test;
